    function normalize(str) {
        return str.toLowerCase()
                  .normalize("NFD").replace(/[̀-ͯ]/g, "")
                  .replace(/[^a-z0-9]/gi, '');
    }

    function tdWrap(value, keyword) {
        const raw = value || "";
        const normValue = normalize(raw);
        const normKeyword = normalize(keyword);
        if (normKeyword && normValue.includes(normKeyword)) {
            return `<td class="highlight-cell">${raw}</td>`;
        } else {
            return `<td>${raw}</td>`;
        }
    }

    function render(data, keyword = "") {
        const table = document.getElementById("result");
        let html = `<tr>
            <th>STT</th><th>Loại xe</th><th>Cà Số</th><th>BKS</th><th>Số máy</th><th>Số khung</th><th>Nhãn hiệu</th>
            <th>Số loại</th><th>Màu sơn</th><th>Ngày VP</th><th>Lô</th><th>STT Đội</th><th>Họ tên</th>
            <th>Địa chỉ</th><th>Năm sinh</th><th>Ghi chú</th>
        </tr>`;
        data.slice(0, 30).forEach((row, i) => {
            html += "<tr>";
            html += `<td>${i+1}</td>`;
            html += tdWrap(row.loai_xe, keyword);
            html += tdWrap(row.ca_so, keyword);
            html += tdWrap(row.bks, keyword);
            html += tdWrap(row.so_may, keyword);
            html += tdWrap(row.so_khung, keyword);
            html += tdWrap(row.nhan_hieu, keyword);
            html += tdWrap(row.so_loai, keyword);
            html += tdWrap(row.mau_son, keyword);
            html += tdWrap(row.ngay_vi_pham, keyword);
            html += tdWrap(row.lo, keyword);
            html += tdWrap(row.stt_doi, keyword);
            html += tdWrap(row.ho_ten, keyword);
            html += tdWrap(row.dia_chi, keyword);
            html += tdWrap(row.nam_sinh, keyword);
            html += tdWrap(row.ghi_chu, keyword);
            html += "</tr>";
        });
        table.innerHTML = html;
    }

    document.getElementById("search").addEventListener("input", function(e) {
        const keyword = normalize(e.target.value);
        const filtered = data.filter(row =>
            normalize(row.bks || "").includes(keyword) ||
            normalize(row.ho_ten || "").includes(keyword) ||
            normalize(row.dia_chi || "").includes(keyword) ||
            normalize(row.so_may || "").includes(keyword) ||
            normalize(row.so_khung || "").includes(keyword) ||
            normalize(row.loai_xe || "").includes(keyword) ||
            normalize(row.nhan_hieu || "").includes(keyword)
        );
        render(filtered, e.target.value);
    });

    render(data);
    </script>
